import React from 'react'
import './input.css'


const Input = ({searchfield, searchChange}) => {
    return (
        <div className="pa2">
            <input 
                className="pa3 ba b--green bg-lightest-blue"
                type="search" 
                placeholder="search robots"
                onChange={searchChange}
            />
        </div>
    );
}

export default SearchBox;
